CREATE OR REPLACE TRIGGER "EIS"."TKULIAH_JAM" BEFORE UPDATE OF "JAM" ON "EIS"."KULIAH" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
DECLARE
tanda_baru number(2);
BEGIN
  if :new.jam is not null then
    ----cek kuliah log
      select count(*) into tanda_baru from kuliah_log where kuliah=:new.nomor and status=0;
      if tanda_baru>0 then        
        update kuliah_log set jam=:new.jam where kuliah=:new.nomor and status=0 and hari=:new.hari;
      else
      end if;        
      ----cek kuliah log    
  else
    ----cek kuliah log
      select count(*) into tanda_baru from kuliah_log where kuliah=:new.nomor and status=0;
      if tanda_baru>0  then        
        update kuliah_log set jam=null where kuliah=:new.nomor and status=0 and hari=:new.hari;
      else
      end if;        
      ----cek kuliah log     
  end if;
