end if;   
END;CREATE OR REPLACE TRIGGER "EIS"."TKULIAH_PARAREL1" AFTER UPDATE OF "HARI_2" ON "EIS"."KULIAH" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
DECLARE
jumlah number(10);
nomor_id number(10);
v_counter number(1);
tanda_baru number(2);
BEGIN
v_counter:=1; 
if :new.hari_2 is null then
  delete from kuliah_pararel where kuliah=:old.nomor and hari=:old.hari_2;
  update kuliah_pararel set hari=null where kuliah=:old.nomor;
   ----cek kuliah log
  select count(*) into tanda_baru from kuliah_log where kuliah=:new.nomor and status=0;
  if tanda_baru>0 then        
      update kuliah_log set hari2=null,hari2_awal=:old.hari_2 where kuliah=:old.nomor and status=0;
  else
  end if;        
  ----cek kuliah log
elsif :new.hari_2 is not null then
  if :old.hari is null then
    RAISE_APPLICATION_ERROR(-20000, 'A completed order cannot be updated');
  end if;
  --if :new.hari_2=:old.hari then
    --RAISE_APPLICATION_ERROR(-20000, 'A completed order cannot be updated');
  --end if;
   
  select count(*) into jumlah from kuliah_pararel where kuliah=:old.nomor;
  if jumlah=16 then
  for i in 1 .. 16
    loop
      values (nkuliah_pararel.nextval,:new.nomor,:new.dosen,i,:new.hari_2,:new.asisten,:new.teknisi);
    end loop;
    update kuliah_pararel set hari=:old.hari where kuliah=:old.nomor and hari is null;
  elsif jumlah>16 then    
    for i in 1 .. 16
      loop
        select nomor into nomor_id from kuliah_pararel where kuliah=:old.nomor and minggu=i and 
        nomor=(select max(nomor) from kuliah_pararel where kuliah=:old.nomor and minggu=i);
        loop
          update kuliah_pararel set hari=:new.hari_2 where nomor=nomor_id;  
          EXIT WHEN v_counter=1;
        end loop;
      end loop;
  end if;
  
  ----cek kuliah log
  select count(*) into tanda_baru from kuliah_log where kuliah=:new.nomor and status=0;
  if tanda_baru>0 then        
      update kuliah_log set hari2=:new.hari_2,hari2_awal=:old.hari_2 where kuliah=:old.nomor and status=0;
  else
  end if;        
  ----cek kuliah log
end if;
END;CREATE OR REPLACE TRIGGER "EIS"."TKULIAH_PARAREL2" AFTER UPDATE OF "HARI" ON "EIS"."KULIAH" REFERENCING OLD AS "OLD" NEW AS "NEW" FOR EACH ROW ENABLE
DECLARE
jumlah number(10);
tanda_baru number(2);
BEGIN 
