  end if;
  ----cek kuliah log
  select count(*) into tanda_baru from kuliah_log where kuliah=:new.nomor and status=0;
  if tanda_baru>0 then        
      update kuliah_log set hari=:new.hari,hari_awal=:old.hari where kuliah=:old.nomor and status=0;
  else
  end if;        
  ----cek kuliah log
end if;
